import axios from "axios";
import { BOOKMARK_RECIPE } from "../components/actionTypes";

const API_URL = "http://localhost:5000";

export const bookmark = (username, recipeId) => {
	return async (dispatch) => {
		await axios.post();
	};
};

const bookmarked = () => {
	type: BOOKMARK_RECIPE;
};
